import React from 'react'
import'../CSS/DisplayCategory.css'
const DisplayCategory = (props) => {
       return (
        <div className='dc'>
            <img src={props.image} alt="" />
            <p >{props.text}</p>
            <p>{props.category}</p>
        </div>
    )

}

export default DisplayCategory
